window.bookSummaryJSON = "<p>Lucy Heron is a mom with three kids, and a baker with a happy marriage in sunny Echo Park. She's also Silver Griffins Agent 485.</p> <p>The suburbs will never be the same.</p> <p>Fighting supernatural crime from a minivan while keeping the magical world a secret is a full time job. Then there's the PTA bake sale and the neighborhood barbecue.</p> <p>Hard to balance even with a wand.</p> <p>And now, a monstrous loan shark is spreading his shadowy empire from a hidden kemana. Mix in a tribe of ancient witches and tunnel-dwelling magical misfits.</p> <p>Turns out, Los Angeles is hiding a lot of secrets just underneath your feet.</p> <p>Can Lucy put the bad guys behind Trevilsom bars and still get home in time for family dinner? What are her magical kids up to and do they have their own spy network?</p>"; 
